import React from "react";
import axios from "axios";
export default function UserProfilePage() {
  const url = "http://localhost:5000/api/users/6190c6fbb62fa29cba2b1322";
  let user;
  const getData = () => {
    axios({
      method: "GET",
      url: url,
      data: {},
    })
      .then((res) => {
        user = res.data.result;
      })
      .catch((e) => {console.log(e)});
  };

  return <h1>{user}</h1>
}
